    "description": "Nascido em Krypton, o pequeno Kal-El viveu pouco tempo em seu planeta natal. Percebendo que o planeta estava prestes a entrar em colapso, seu pai (Russell Crowe) o envia ainda bebê em uma nave espacial, rumo ao planeta Terra, e levando com ele importantes informações de seu povo. Contrariado com tal atitude, o General Zod (Michael Shannon) tenta impedir a iniciativa e acaba preso. Já em seu novo lar, a criança foi criada por Jonathan (Kevin Costner) e Martha Kent (Diane Lane), que passaram a chamá-lo de Clark. O tempo passa, seus poderes vão aparecendo e se tornando, de certa forma, um problema, porque isso evidencia que ele não é um ser humano. Já adulto, Clark (Henry Cavill) se vê obrigado a buscar um certo isolamento porque não consegue resistir aos salvamentos das pessoas e sempre precisa sumir do mapa para não criar problemas para seus pais. Mas o terrível Zod conseguiu se libertar e descobriu seu paradeiro. Agora, a humanidade corre perigo e talvez tenha chegado a hora das pessoas conhecerem aqueles que passarão a chama de o Super-Homem.\n"
