    "description": "\n\tNo início de janeiro de 1923, na Flórida, a comunidade negra de Rosewood é atacada, queimada e tem parte da população morta por brancos de uma cidade vizinha em um espaço de quatro dias. Tudo isto pelas falsa alegações de uma mulher branca (Catherine Kellner), que foi espancada pelo amante (Robert Patrick) também branco mas teve medo de contar ao marido (Loren Dean) e achou mais \"conveniente\" dizer que tinha sido atacada por um negro. O xerife (Michael Rooker) tem dúvidas quando a veracidade dos fatos, mas é uma verdade que convêm, pois permite aos brancos darem vazão ao seu enorme preconceito. Mas um negro, que tinha chegado recentemente em Rosewood e pretendia se estabelecer por lá após ter lutado na Grande Guerra, decide combater os agressores e salvar quantos negros forem possíveis. Para isto pede auxílio ao único comerciante branco de Rosewood, que não sabe se fica com os brancos ou com a verdade.\n"
