    "description": "\n\tCapitão Winters leva Easy Company num ataque contra o que eles pensavam que era um ninho de metralhadora. O ataque é bem-sucedido na medida em que praticamente acaba com o inimigo. No rescaldo da desastrosa Operação Market , Easy Company é atribuído a prestar assistência a um grande grupo de britânicos que estão presos nas linhas inimigas. Mais tarde, os homens de repente encontram todos os passes canceladó e eles mudam-se rapidamente para Bastogne para ajudar a defender a cidade da ofensiva alemã. A empresa é agora liderada pelo Tenente Norman Dike, para quem os homens têm pouco respeito.\n"
