    "description": "\n\tHome (Home: A Minha Casa (título em Portugal) ou Cada Um na Sua Casa (título no Brasil)) é um filme de animação e aventura em 3D norte-americano, produzido pela DreamWorks Animation e distribuído pela 20th Century Fox. Com realização de Tim Johnson e produção de Chris Jenkins e Suzanne Buirgy, é baseado no livro infantil The True Meaning of Smekday, de Adam Rex. O elenco é composto por Jim Parsons, Rihanna, Steve Martin, Jennifer Lopez e Matt Jones, que dão voz às personagens animadas. O seu lançamento ocorreu a 19 de Março na Austrália, 26 de Março em Portugal, no dia seguinte nos Estados Unidos e dia 9 de Abril no Brasil.\n"
