    "description": "\n\tO faroleiro Tom Sherbourne e a sua esposa Isabel, formam um casal feliz que vive numa ilha na costa da Austrália, no período após a Primeira Guerra Mundial. O maior desejo de Tom e Isabel é poderem trazer uma criança ao mundo, mas depois de Isabel abortar, perderam a esperança de que tal possa acontecer. No entanto, um dia o casal resgata uma menina que deu à costa, sozinha num barco a remo. Os dois decidem chamá-la de Lucy e adotá-la como sua filha. Depois de anos de felicidade, Tom e Isabel, numa visita ao continente, encontram a viúva Hannah Roennfeldt, que perdeu o marido e a filha no mar. Torna-se claro para Tom que Lucy é filha de Hannah, e ele sente que é o seu dever devolver a criança à mãe. Mas Isabel não quer que a sua família feliz seja destruída. Um maravilhoso sonha transforma-se então num pesadelo, trazendo à superfície questões difíceis sobre o casamento e a paternidade.\n"
