    "description": "Em Londres, dentro de uma sombria câmara do Museu Britânico, está para renascer uma antiga força do terror. É 1933, o ano do Escorpião. Faz dez anos desde que o corajoso Rick O'Connell (Brendan Fraser) e a egiptóloga Evelyn (Rachel Weisz) lutaram por suas vidas contra Imhotep (Arnold Vosloo), um inimigo com 3.000 anos. Agora Rick e Evelyn estão casados e moram em Londres, juntamente com seu filho, Alex (Freddie Boath), que tem oito anos. Vários eventos culminam com a descoberta do corpo de Imhotep ressuscitado, graças à ajuda da reencarnação de sua amada do antigo Egito, Anck-Su-Naman (Patricia Velazquez), que matou e morreu por ele. Assim, a múmia volta a vagar pela Terra, determinada em concretizar sua busca pela imortalidade. Porém, outra força também está à solta no mundo, o Escorpião Rei (Dwayne Johnson), que nasceu dos obscuros rituais do misticismo egípcio e é ainda mais poderoso que Imhotep. Quando se defrontarem, o destino da Terra estará em perigo e Rick e Evelyn darão início à uma corrida desesperada para salvar o mundo de um mal indescritível e também para resgatar Alex dos seguidores de Imhotep, que levaram o menino pois este, sem ter idéia, colocou no braço o bracelete de Anúbis, um artefato de incrível poder. Nessa jornada irão até o Egito e entrarão nos domínios do Escorpião Rei. Há muito tempo esse terrível guerreiro prometeu sua alma ao deus Anúbis em troca de soberania militar. Ele e seu exército ficaram congelados no tempo, em uma espécie de intervalo entre a vida e a morte, mas agora estão prontos para matar novamente. O Escorpião Rei possui mais poderes, segredos e força que o temível Imhotep, está cheio de ódio e não devia ser perturbado."
