    "description": "Após já ter cumprindo uma pena de 21 anos e 6 meses na penitenciária de Atborough, Manuel Jordan (Billy Bob Thornton) acha que merece ficar na prisão o resto da vida, pois numa tentativa de assalto acabou matando um jovem, Abner Easley (Geoffrey Wigdor). Jordan olha sempre um recorte de jornal com o rosto de sua vítima, como uma espécie de punição adicional. Para sua surpresa, a junta de livramento condicional decide libertá-lo. Jordan tinha na cabeça algo que lera em um livro do século XI, que para alguém reparar um mal feito eram necessários 5 passos. O primeiro era reconhecer o que fez, o segundo o remorso, o terceiro ser justo com o seu próximo, que significa que se alguém roubou algo deve devolver (mas a vida de Abner não pode ser restituída). O quarto é pedir perdão a Deus, mas só no quinto passo realmente poderá se redimir, que é estar no mesmo lugar e situação mas agir de forma diferente. Jordan acha impossível cumprir os três últimos passos, pois depois do que fez Deus não irá acolhê-lo e acha impossível estar no mesmo lugar e situação. Desta forma crê que jamais terá perdão, assim volta para a sua cidade em busca de redenção. Ele acaba indo viver e trabalhar numa casa comunitária que ajuda os mais carentes, administrada por Miles Evans (Morgan Freeman), um pregador. Sem se identificar, Jordan faz amizade com a irmã da sua vítima, Adele (Holly Hunter), numa tentativa de compensar em parte seu crime. Jordan também conhece Sofia Mellinger (Kirsten Dunst), uma jovem que vai a uma discoteca próxima do lugar onde ele vive e bebe tanto que no dia seguinte não se lembra mais de nada. Na verdade Sophia quer esquecer que está numa crise financeira, pois sua mãe, Claire (Catherine Colvey), uma famosa cantora do passado, nada tem e a casa onde vivem pertence ao banco, mas por ser localizada em um elegante bairro faz que muitos acreditem que ela é rica."
