    "description": "Após se separar da sua esposa e parceira de pesquisa por um longo tempo, Robert Campbell (Sean Connery), um cientista, transfere seu laboratório para o interior da floresta amazônica. Depois de três anos de total silêncio, ele pede uma assistente e um cromatógrafo a gás, sem dar maiores explicações. Na verdade ele aparentemente encontrou a cura do câncer, mas não consegue duplicá-lo em laboratório. A chegada de Rae Crane (Lorraine Bracco), uma bioquímica que veio dos Estados Unidos para auxiliá-lo em seu trabalho e tentar entender o que acontece, pois o Laboratório Aston, que patrocina o projeto, nunca recebe um relatório de gastos e de descobertas e Crane é o juiz e júri, que pode acabar com a verba de Campbell. Esta situação provoca inicialmente um choque de personalidades, que gradativamente é transformado em respeito mútuo. Juntos eles tentam entender por qual motivo o soro, que aparentemente tem origem na bromélia, uma flor que só cresce lá há trinta metros do solo, não consegue ser sintetizado."
