    "url": "http://cinetop.co.mz/storage/film/AWalkintheClouds.mp4",
    "description": "Depois de 4 anos nos campos de batalha da 2ª Guerra Mundial e ainda relembrando os horrores de guerra, Paul Sutton (Keanu Reeves) ao retornar para casa quer se estabelecer e começar uma fazenda, mas Betty (Debra Messing), sua esposa, com quem impulsivamente se casou três dias após se conhecerem (no dia seguinte ele rumava para o front), quer que ele venda chocolates e até já arrumou um emprego para Paul. Enquanto faz uma viagem de negócios, ele ajuda uma hispano-americana, Victoria Aragón (Aitana Sánchez-Gijón), uma bela mulher que na faculdade se apaixonou por um professor que a engravidou, mas não quis se casar com ela. Ela volta para casa totalmente envergonhada e, temerosa da reação do seu pai, Alberto (Giancarlo Giannini), mas Paul tem uma idéia: ele se fará passar como o marido dela e partirá após um dia ou dois. Assim quando Victoria ficar só com a criança, a desgraça estará nele, não ela. Ela concorda e os dois chegam como marido e mulher no vinhedo Las Nubes, que é de propriedade da família dela. A maioria da família Aragón recebe Paul afetuosamente, especialmente o avô, Don Pedro (Anthony Quinn), o patriarca, mas o pai dela sente que há algo com o jovem casal e trata Paul grosseiramente. Paul e Victoria contornam várias situações e, durante a celebração da colheita, descobrem que estão fortemente apaixonados. Entretanto, algumas barreiras impedem que eles concretizem este amor."
