    "url": "http://cinetop.co.mz/storage/film/LHumanité.mp4",
    "description": "Em uma cidade perto de Lille, Pharaon De Winter (Emmanuel Schotté), um superintendente da polícia solitário e melancólico, vive com sua mãe na casa que foi do avô dele, um pintor famoso. Pharaon tem trinta anos e ainda não se recuperou de ter perdido a mulher e a filha, há dois anos. Uma menina de onze anos foi estuprada e assassinada. Na próxima semana, De Winter investiga o caso e paralelamente segue com sua simplória vida, que se resume em andar de bicicleta, cuidar da horta e ir jantar no litoral com sua amiga, Domino (Séverine Caneele) e Joseph (Philippe Tullier), seu namorado, e chega mesmo uma vez em observar pateticamente o casal, quando estão tendo relações. Por sinal fazer sexo para Domino é a forma de ela se comunicar. O que faz Pharaon diferente dos outros é o sofrimento que tem, devido à empatia incontrolável pelos seres humanos. É uma esponja emocional, condenada em levar o fardo de todos nossos males. Ele tem fome de sentimentos humanos, ao ponto de cheirar a face dos suspeitos que interroga."
