    "description": "David Basner (Tom Hanks) sempre foi um homem infantil, mas o seu jeito o levou ao sucesso, já que trabalha em uma agência de publicidade que o paga para pensar assim, além de zombar de seus colegas. Ele leva uma vida confortável e independente: tem dinheiro, muitas mulheres e um relacionamento distante com seus pais. Mas isso muda quando eles se separam. Agora, David precisa cuidar deles sem prejudicar os outros aspectos de sua vida, já que sua mãe (Eva Marie Saint) passa a aproveitar a independência e precisa ser controlada, e seu pai (Jackie Gleason), recém demitido e teimoso, cai na tristeza e passa a esconder coisas do filho."
