    "description": "Jeff (Kurt Russell) e Amy Taylor (Kathleen Quinlan) se mudam para San Diego, Califórnia, dirigindo através do deserto. De repente o carro deles sofre uma pane e logo aparece um caminhoneiro que se prontifica a ajudá-los. Jeff decide não abandonar o carro, assim Amy decide pegar sozinha uma carona até um restaurante para poder chamar um guincho. Mas logo após a partida da esposa, Jeff resolve o problema do carro e vai ao encontro dela em um restaurante de estrada. Porém, ninguém a viu lá e, ao tentar encontrá-la, localiza o caminhoneiro que deu carona a Amy, mas este nega conhecê-lo (inclusive diz isto para um policial) e afirma que não deu carona nenhuma. Desesperado, Jeff começa a entender que está envolvido em uma perigosa trama e que Amy foi seqüestrada."
