    "description": "Georgia, 1909. Em uma pequena cidade Celie (Whoopi Goldberg), uma jovem com apenas 14 anos que foi violentada pelo pai, se torna mãe de duas crianças. Além de perder a capacidade de procriar, Celie imediatamente é separada dos filhos e da única pessoa no mundo que a ama, sua irmã, e é doada a \"Mister\" (Danny Glover), que a trata simultaneamente como escrava e companheira. Grande parte da brutalidade de Mister provêm por alimentar uma forte paixão por Shug Avery (Margaret Avery), uma sensual cantora de blues. Celie fica muito solitária e compartilha sua tristeza em cartas (a única forma de manter a sanidade em um mundo onde poucos a ouvem), primeiramente com Deus e depois com a irmã Nettie (Akosua Busia), missionária na África. Mas quando Shug, aliada à forte Sofia (Oprah Winfrey), esposa de Harpo (Willard E. Pugh), filho de Mister, entram na sua vida, Celie revela seu espírito brilhante, ganhando consciência do seu valor e das possibilidades que o mundo lhe oferece."
