    "description": "Peter Sullivan (Zachary Quinto), Seth Bregman (Penn Badgley) e Will Emerson (Paul Bettany) trabalham no setor de riscos em uma corretora, que está realizando uma série de demissões. Cerca de 80% do setor em que trabalham foi demitido, entre eles o chefe do trio, Eric Dale (Stanley Tucci). Ao pegar o elevador Eric entrega a Peter um pen drive, que contém algo em que estava trabalhando no momento. O alerta para que tomasse cuidado com o conteúdo chama a atenção de Peter, que fica após o horário de trabalho para dar uma olhada no arquivo. Logo ele descobre que trata-se de uma análise da volatilidade da empresa, que indica que há duas semanas ela ultrapassou e muito o limite de risco o qual pode correr. Desta forma a empresa está prestes a falir, o que provoca uma reunião de emergência com diversos setores da empresa, entre eles seu dono, o acionista John Tuld (Jeremy Irons)."
