    "url": "http://cinetop.co.mz/storage/film/TheGunsofNavarone.mp4",
    "description": "Grécia, 1943. Dois mil soldados britânicos perderam-se em Kheros. Exaustos e indefesos, eles têm apenas uma semana para partir, pois em Berlim o supremo comando do eixo determinara fazer uma demonstração de força no Mar Egeu, para fazer a Turquia entrar na guerra do seu lado. A demonstração seria em Kheros, sem valor militar, mas próximo à costa da Turquia. O melhor armamento alemão seria usado e assim os britânicos seriam facilmente dominados, a não ser que pudessem fugir antes. Porém a única rota de fuga possível estava bloqueada, pois dois canhões enormes controlados por um radar estavam em Navarone, uma ilha vizinha. Assim, um grupo aliado tem a quase impossível missão de escalar uma parede de rocha em Navarone e invadir uma fortaleza nazista, onde estão os canhões, que se não forem destruídos vão afundar diversos navios aliados, pondo um fim na tentativa de resgatar os soldados britânicos."
